e {\r\n	border: solid 1px #CEE2F2;\r\n	background-color: #F0F5FF;\r\n}\r\n\r\n.progressName {\r\n	font-size: 8pt;\r\n	font-weight: 700;\r\n	color: #555;\r\n	width: 323px;\r\n	height: 14px;\r\n	text-align: left;\r\n	white-space: nowrap;\r\n	overflow: hidden;\r\n}\r\n\r\n.progressBarInProgress,\r\n.progressBarComplete,\r\n.progressBarError {\r\n	font-size: 0;\r\n	width: 0%;\r\n	height: 2px;\r\n	background-color: blue;\r\n	margin-top: 2px;\r\n}\r\n\r\n.progressBarComplete {\r\n	width: 100%;\r\n	background-color: green;\r\n	visibility: hidden;\r\n}\r\n\r\n.progressBarError {\r\n	width: 100%;\r\n	background-color: red;\r\n	visibility: hidden;\r\n}\r\n\r\n.progressBarStatus {\r\n	margin-top: 2px;\r\n	width: 337px;\r\n	font-size: 7pt;\r\n	font-family: Arial;\r\n	text-align: left;\r\n	white-space: nowrap;\r\n}\r\n\r\na.progressCancel {\r\n	font-size: 0;\r\n	display: block;\r\n	height: 14px;\r\n	width: 14px;\r\n	background-image: url(../images/cancelbutton.gif);\r\n	background-repeat: no-repeat;\r\n	background-position: -14px 0px;\r\n	float: right;\r\n}\r\n\r\na.progressCancel:hover {\r\n	background-position: 0px 0px;\r\n}\r\n\r\n/* -- SWFUpload Object Styles ------------------------------- */\r\n.swfupload {\r\n	\r\n	position: absolute;\r\n	z-index:1;\r\n\r\n\r\n}\r\n\r\n\r\n\r\n</style>\r\n\r\n\r\n<script>\r\nloadjs(''<?php return base_url().''/swfupload/api/swfupload.js'';?>'',''swfupload'');\r\n\r\nloadjs(''<?php return base_url().''/swfupload/js/fileprogress.js'';?>'',''fileprogress'');\r\n\r\nloadjs(''<?php return base_url().''/swfupload/js/handlers.js'';?>'',''handlers'');\r\n\r\nloadjs(''<?php return base_url().''/swfupload/js/swfupload.queue.js'';?>'',''swfupload_queue'');\r\n\r\n\r\n\r\n\r\n<?php\r\n\$CI = &get_instance();\$CI->Common_model->set_uid();\r\n?>\r\n\r\n\r\nvar s_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\r\n = (function(){\r\n\r\n\r\n\r\n\$(function(\$){\r\n\r\n\r\n	\r\n	var upload_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?> = new SWFUpload({\r\n				// Backend Settings\r\n				upload_url: \"<?php return base_url();?>/swfupload/upload.php\",\r\n				post_params: {\"test\":\"1\",\"save_path\":''<?php return base64_encode(getcwd().\"/swfupload/uploads/\");?>''},\r\n				// File Upload Settings\r\n				file_size_limit : \"100\",	// 100k\r\n				file_types : \"*.jpg;*.gif;*.png\",\r\n				file_types_description : \"JPG Images;GIF Images;PNG Images\",\r\n				file_upload_limit : \"1\",\r\n				file_queue_limit : \"0\",\r\n				// Event Handler Settings (all my handlers are in the Handler.js file)\r\n				file_dialog_start_handler : fileDialogStart,\r\n				file_queued_handler : fileQueued,\r\n				file_queue_error_handler : fileQueueError,\r\n				file_dialog_complete_handler : fileDialogComplete,\r\n				upload_start_handler : uploadStart,\r\n				upload_progress_handler : uploadProgress,\r\n				upload_error_handler : uploadError,\r\n				upload_success_handler : uploadSuccess,\r\n				upload_complete_handler : uploadComplete,\r\n				queue_complete_handler : queueComplete, \r\n				// Button Settings\r\n				button_placeholder_id : \"spanButtonPlaceholder_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\",\r\n			   \r\n				button_width: 80,\r\n				button_height: 20,\r\n				\r\n				button_window_mode: SWFUpload.WINDOW_MODE.TRANSPARENT,\r\n				button_cursor: SWFUpload.CURSOR.HAND,\r\n\r\n\r\n				// Flash Settings\r\n				flash_url : \"<?php return base_url();?>/swfupload/api/swfupload.swf\",\r\n				custom_settings : {\r\n					progressTarget : \"fsUploadProgress_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\",\r\n					cancelButtonId : \"btnCancel_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\"\r\n				},\r\n				// Debug Settings\r\n				debug: false\r\n			});\r\n\r\n\r\n\r\n\r\n})\r\n			\r\nfunction queueComplete(){\r\n}\r\n\r\n\r\n\r\n\r\nfunction uploadSuccess(file, serverData) {\r\n	try {\r\n\r\n		var progress = new FileProgress(file, this.customSettings.progressTarget);\r\n		progress.setComplete();\r\n	//	progress.setStatus(\"Complete.\");\r\n		progress.toggleCancel(false);\r\nvar img_url = ''<?php return base_url();?>/swfupload/uploads/''+file.name;\r\nvar input_hid = \$(\"#pic_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\");\r\ninput_hid .val(img_url);\r\n\$(''#pic_prev_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>'').attr(''src'',img_url);\r\n\r\n\r\nvar Editor = FCKeditorAPI.GetInstance(''content'');\r\n\r\nif(typeof(Editor)!=\"undefined\"){\r\nEditor .InsertHtml(\$(''#pic_prev_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>'')[0].outerHTML); \r\n}\r\n\r\n\r\n\r\n	} catch (ex) {\r\n		//this.debug(ex);\r\n	}\r\n}\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\n\r\n})();\r\n\r\n	\r\n\r\n\r\n</script>\r\n\r\n\r\n\r\n	\r\n	\r\n\r\n<span id=\"spanButtonPlaceholder_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\"></span>\r\n\r\n<input id=\"btnUpload\" type=\"button\" value=\"??\" style=\"width: 80px; height: 20px; \" />	\r\n<input type=\"hidden\" name=\"%name\" id=\"pic_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\" value=\"%value\" />\r\n\r\n<div class=\"flash\"  id=\"fsUploadProgress_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\">\r\n<span class=\"legend\"></span>\r\n			\r\n</div>\r\n	\r\n<img src=\"%value\" id=\"pic_prev_<?php \$CI = &get_instance();return \$CI->Common_model->get_uid();?>\" style=\"width:80px;height:60px;border:1px solid #cccccc;padding:2px\" >','1'),
